      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.12;

import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./ERC721Enumerable.sol";

contract SpaceWalkers is ERC721Enumerable, Ownable {
    string public baseURI;

    address public proxyRegistryAddress;
    address public developer;

    bytes32 public whitelistMerkleRoot;
    uint256 public MAX_SUPPLY;

    uint256 public constant MAX_PER_TX = 3;
    uint256 public constant priceInWei = 0.08 ether;

    mapping(address => bool) public projectProxy;
    mapping(address => uint256) public addressToMinted;

    constructor(
        string memory _baseURI,
        bytes32 _whitelistMerkleRoot,
        address _proxyRegistryAddress,
        address _developer
    ) ERC721("Space Walkers Collection", "Space Walkers") {
        baseURI = _baseURI;
        whitelistMerkleRoot = _whitelistMerkleRoot;
        proxyRegistryAddress = _proxyRegistryAddress;
        developer = _developer;
    }

    function setBaseURI(string memory _baseURI) public onlyOwner {
        baseURI = _baseURI;
    }

    function tokenURI(uint256 _tokenId)
        public
        view
        override
        returns (string memory)
    {
        require(_exists(_tokenId), "Token does not exist.");
        return
            string(
                abi.encodePacked(
                    baseURI,
                    Strings.toString(_tokenId + 1),
                    ".json"
                )
            );
    }

    function setProxyRegistryAddress(address _proxyRegistryAddress)
        external
        onlyOwner
    {
        proxyRegistryAddress = _proxyRegistryAddress;
    }

    function flipProxyState(address proxyAddress) public onlyOwner {
        projectProxy[proxyAddress] = !projectProxy[proxyAddress];
    }

    function setMerkleRoot(bytes32 _whitelistMerkleRoot) external onlyOwner {
        whitelistMerkleRoot = _whitelistMerkleRoot;
    }

    function togglePublicSale() external onlyOwner {
        delete whitelistMerkleRoot;
        MAX_SUPPLY = 3720 - _owners.length;
    }

    function _leaf(
        string memory allowance,
        string memory startTime,
        string memory endTime,
        string memory payload
    ) internal pure returns (bytes32) {
        return
            keccak256(abi.encodePacked(payload, startTime, endTime, allowance));
    }

    function _verifyWhitelist(bytes32 leaf, bytes32[] memory proof)
        internal
        view
        returns (bool)
    {
        return MerkleProof.verify(proof, whitelistMerkleRoot, leaf);
    }

    function whitelistMint(
        uint256 count,
        uint256 startTime,
        uint256 endTime,
        uint256 allowance,
        bytes32[] calldata proof
    ) public payable {
        string memory payload = string(abi.encodePacked(_msgSender()));
        require(
            _verifyWhitelist(
                _leaf(
                    Strings.toString(allowance),
                    Strings.toString(startTime),
                    Strings.toString(endTime),
                    payload
                ),
                proof
            ),
            "Invalid Merkle Tree proof supplied."
        );
        require(
            addressToMinted[_msgSender()] + count <= allowance,
            "Exceeds whitelist supply"
        );
        require(
            count * (priceInWei - 0.008 ether) == msg.value,
            "Invalid funds provided."
        );

        addressToMinted[_msgSender()] += count;
        uint256 totalSupply = _owners.length;
        for (uint256 i; i < count; i++) {
            _mint(_msgSender(), totalSupply + i);
        }
    }

    function publicMint(uint256 count) public payable {
        uint256 totalSupply = _owners.length;
        require(totalSupply + count < MAX_SUPPLY, "Excedes max supply.");
        require(
            addressToMinted[_msgSender()] + count <= MAX_PER_TX,
            "Exceeds max per user."
        );
        require(count * priceInWei == msg.value, "Invalid funds provided.");

        addressToMinted[_msgSender()] += count;
        for (uint256 i; i < count; i++) {
            _mint(_msgSender(), totalSupply + i);
        }
    }

    function burn(uint256 tokenId) public {
        require(
            _isApprovedOrOwner(_msgSender(), tokenId),
            "Not approved to burn."
        );
        _burn(tokenId);
    }

    function withdraw() public {
        (bool developerSuccess, ) = developer.call{
            value: (address(this).balance * 3) / 100
        }("");
        require(developerSuccess, "Failed to send to developer.");

        (bool success, ) = owner().call{value: address(this).balance}("");
        require(success, "Failed to send to owner.");
    }

    function walletOfOwner(address _owner)
        public
        view
        returns (uint256[] memory)
    {
        uint256 tokenCount = balanceOf(_owner);
        if (tokenCount == 0) return new uint256[](0);

        uint256[] memory tokensId = new uint256[](tokenCount);
        for (uint256 i; i < tokenCount; i++) {
            tokensId[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokensId;
    }

    function batchTransferFrom(
        address _from,
        address _to,
        uint256[] memory _tokenIds
    ) public {
        for (uint256 i = 0; i < _tokenIds.length; i++) {
            transferFrom(_from, _to, _tokenIds[i]);
        }
    }

    function batchSafeTransferFrom(
        address _from,
        address _to,
        uint256[] memory _tokenIds,
        bytes memory data_
    ) public {
        for (uint256 i = 0; i < _tokenIds.length; i++) {
            safeTransferFrom(_from, _to, _tokenIds[i], data_);
        }
    }

    function isOwnerOf(address account, uint256[] calldata _tokenIds)
        external
        view
        returns (bool)
    {
        for (uint256 i; i < _tokenIds.length; ++i) {
            if (_owners[_tokenIds[i]] != account) return false;
        }

        return true;
    }

    function isApprovedForAll(address _owner, address operator)
        public
        view
        override(ERC721, IERC721)
        returns (bool)
    {
        OpenSeaProxyRegistry proxyRegistry = OpenSeaProxyRegistry(
            proxyRegistryAddress
        );
        if (
            address(proxyRegistry.proxies(_owner)) == operator ||
            projectProxy[operator]
        ) return true;
        return super.isApprovedForAll(_owner, operator);
    }

    function _mint(address to, uint256 tokenId) internal virtual override {
        _owners.push(to);
        emit Transfer(address(0), to, tokenId);
    }
}

contract OwnableDelegateProxy {}

contract OpenSeaProxyRegistry {
    mapping(address => OwnableDelegateProxy) public proxies;
}
